import React from 'react';
import './Logo.css';

function Logo() {
  return (
      <div id="luxy" className="logo">
          <h1 class="luxy-el" data-speed-y="5" data-offset="-50">
              <a href="./">SATO YOHEI
                  <span> WEB ENGINEER</span>
              </a>
          </h1>

      </div>
  );
}

export default Logo;
